import React from 'react'
import classes from "./StudentCard.module.css"
export const StudentCard = () => {
  return (
    <>
    <div className={classes.card}>
        <div style={{ disp }}>
            <div style={{ width:"75px",height:"60px",background:"#EAEE0D" }}></div>
        </div>
    </div>
    </>
  )
}
